import React from 'react'
import { LineChart, Line, XAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

import "./chart.css"
export default function Chart() {

    const data = [
        {
            name: 'Enero',
            "Usuarios Activos": 200
        },
        {
            name: 'Febrero',
            "Usuarios Activos": 200
        },
        {
            name: 'Marzo',
            "Usuarios Activos": 4000
        },
        {
          name: 'Abril',
          "Usuarios Activos": 3000
        },
        {
          name: 'Mayo',
          "Usuarios Activos": 2000
        },
        {
          name: 'Junio',
          "Usuarios Activos": 2780
        },
        {
          name: 'Julio',
          "Usuarios Activos": 1890
        },
        {
          name: 'Agosto',
          "Active User": 2390
        },
        {
          name: 'Septiembre',
          "Active User": 3490
        },
        {
            name: 'Octubre',
            "Active User": 5490
          },
      ];

    return (
        <div className="chart">
            <h3 className="chartTitle">Usuarios Activos</h3>
            <ResponsiveContainer width="100%" aspect={4/1}>
                <LineChart data={data}>
                    <XAxis dataKey="name" stroke="#5550bd" />
                    <Line type="monotone" dataKey="Usuarios Activos" stroke="#5550bd"/>
                    <Tooltip />
                    <CartesianGrid stroke="#e0dfdf" strokeDasharray="5 5"/>
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}
